import React,{Component} from 'react'
import TodoItem from './todo-item';
import todoitem from './todo-item'

export default class TodoList extends Component {
    constructor(props) {
        super(props);
    }

    element = () => {
        this.props.map(elem => {
            const {id, title, done} = this.elem;
            return (
                <li key={id}>
                    <TodoItem title done></TodoItem>
                </li>
            )
        })
    }

    render() {

        return (
            <ul>
                {element()}
            </ul>
        )
    }
}
